
import Data.List

-- [(a, b)] = a contains b
reverseRules :: [(String, [(Int, String)])] -> [(String, String)]
reverseRules
  = concat . map reverseRule
    where
      reverseRule :: (String, [(Int, String)]) -> [(String, String)]
      reverseRule (container, containees)
        = map (\(_, c) -> (container, c)) containees

partOne :: [(String, [(Int, String)])] -> Int
partOne rawRules
  = length
  $ nub
  $ getContainers "shiny_gold"
    where
      rules = reverseRules rawRules

      getContainers :: String -> [String]
      getContainers gold
        = concat (containers : map getContainers containers)
          where
            containers = [container | (container, containee) <- rules, containee == gold]

partTwo :: [(String, [(Int, String)])] -> Int
partTwo rules
  = weight (1, "shiny_gold") - 1
    where
      weight :: (Int, String) -> Int
      weight (n, colour)
        = n * (1 + sum (map weight contains))
          where
            Just contains = lookup colour rules

